"""**Calculando los retornos**

Un retorno financiero es simplemente el dinero ganado o perdido en una inversi칩n. Un retorno puede ser expresado nominalmente como el cambio en el importe de una inversi칩n a lo largo del tiempo. Se puede calcular como el porcentaje derivado de la relaci칩n entre beneficio e inversi칩n.

La f칩rmula usada en pct_change es:
Rendimiento = {(Precio al t)-(Precio al t-1)} / {Precio en t-1}

Con los precios de cierre, buscamos el rendimiento diario de las acciones propuestas
"""

